import React, {useState, useEffect} from 'react';
import { checkServiceConnection } from '../functions/functions';

export default function Test() {

    const [response, setResponse] = useState();
    const [isLoading, setLoading] = useState(true)


    const fetchData = () => {
        if (checkServiceConnection("lastfm")) {
            fetch("/get-lastfm-songs?start_date=1672436308&end_date=1672409068&user=" + localStorage.getItem("lastfm_name"))
                .then(res => res.json())
                .then((response) => {
                    setResponse(response);
                    setLoading(false);
                });
        }
    }

    useEffect(() => {
        fetchData();
    }, []);

    if (isLoading) {
        return "Loading";
    }

    return (
        <div>
            <p>{response}</p>
        </div>
    )
}
